    function showMap() {

        map = L.map('map').setView([39, 105], 5);
        L.esri.tiledMapLayer({
            url: "http://192.103.106.100:6080/arcgis/rest/services/Base/World/MapServer"
        }).addTo(map);
    }

    function addSetPositionPanel()
    {
        var toolbar = new L.control.toolbar({
            collapsed: true,
            position: 'topright',
            autoZIndex: true
        });
        toolbar.addTo(map);

        var setPositionBtn = new setPosition({panelParentID:"setPositionPanel"});
        setPositionBtn.addTo(toolbar);

        var hidePanelImg = setPositionBtn.getHidePanelImg();
        hidePanelImg.onclick = function()
        {
            $("#out-panel").animate({width:"hide"},500); //隐藏地图定位面板
        };

        var outBtn = setPositionBtn.getBtn();
        outBtn.onclick = function()
        {
            if($("#out-panel").is(':visible'))
            {
                if(showPanelID == "setPositionPanel")
                {
                    $("#out-panel").animate({width:"hide"},500); //隐藏地图定位面板
                }
                else
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "setPositionPanel";
                    $("#"+showPanelID).show();
                }
            }
            else
            {
                if(showPanelID != "setPositionPanel")
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "setPositionPanel";
                    $("#"+showPanelID).show();
                }
                $("#out-panel").animate({width:"show"},500); //显示地图定位面板
            }

            $("#map").css("min-height","190px");
        }
    }

    function addSetLayerPanel()
    {
        var toolbar = new L.control.toolbar({
            collapsed: true,
            position: 'topright',
            autoZIndex: true
        });
        toolbar.addTo(map);

        var setLayer = new setLayerInfo({panelParentID:"setLayerPanel"});
        setLayer.initialize(toolbar);

        setLayer.getCloseElement().onclick = function(){
            $("#out-panel").animate({width:"hide"},500); //隐藏面板
        };

        setLayer.getRelativeBtn().onclick = function(){
            if($("#out-panel").is(':visible'))
            {
                if(showPanelID == "setLayerPanel")
                {
                    $("#out-panel").animate({width:"hide"},500); //隐藏面板
                }
                else
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "setLayerPanel";
                    $("#"+showPanelID).show();
                }
            }
            else
            {
                if(showPanelID != "setLayerPanel")
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "setLayerPanel";
                    $("#"+showPanelID).show();
                }
                $("#out-panel").animate({width:"show"},500); //显示地图定位面板
            }
            $("#map").css("min-height","150px");
        }
    }

    function addPOISearchPanel()
    {
        var toolbar = new L.control.toolbar({
            collapsed: true,
            position: 'topright',
            autoZIndex: true
        });
        toolbar.addTo(map);

        var setPOIInfo = new setSearchPOIInfo({panelParentID:"searchPOIPanel"});
        setPOIInfo.initialize(toolbar);

        setPOIInfo.getCloseElement().onclick = function(){
            $("#out-panel").animate({width:"hide"},500); //隐藏面板
        };

        setPOIInfo.getRelativeBtn().onclick = function(){
            if($("#out-panel").is(':visible'))
            {
                if(showPanelID == "searchPOIPanel")
                {
                    $("#out-panel").animate({width:"hide"},500); //隐藏面板
                }
                else
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "searchPOIPanel";
                    $("#"+showPanelID).show();
                }
            }
            else
            {
                if(showPanelID != "searchPOIPanel")
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "searchPOIPanel";
                    $("#"+showPanelID).show();
                }
                $("#out-panel").animate({width:"show"},500); //显示地图定位面板
            }
            $("#map").css("min-height","505px");
        };

        setPOIInfo.setQueryResultLayer(map);

        //定义web页面大小变化时事件
        $(window).resize(function()
        {
            if(showPanelID == "searchPOIPanel")
            {
                //重新设置查询结果面板的高度
                setPOIInfo.windowResize();
            }
        });
    }

    function addAimTrackPanel()
    {
        var toolbar = new L.control.toolbar({
            collapsed: true,
            position: 'topright',
            autoZIndex: true
        });
        toolbar.addTo(map);

        var setAimTrack = new setAimTrackInfo({panelParentID:"manageAimTrackPanel"});
        setAimTrack.initialize(toolbar,setAimTrack);

        setAimTrack.getCloseElement().onclick = function(){
            $("#out-panel").animate({width:"hide"},500); //隐藏面板
        };

        setAimTrack.getRelativeBtn().onclick = function(){
            if($("#out-panel").is(':visible'))
            {
                if(showPanelID == "manageAimTrackPanel")
                {
                    $("#out-panel").animate({width:"hide"},500); //隐藏面板
                }
                else
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "manageAimTrackPanel";
                    $("#"+showPanelID).show();
                }
            }
            else
            {
                if(showPanelID != "manageAimTrackPanel")
                {
                    $("#"+showPanelID).hide();
                    showPanelID = "manageAimTrackPanel";
                    $("#"+showPanelID).show();
                }
                $("#out-panel").animate({width:"show"},500); //显示地图定位面板
            }
//            $("#map").css("min-height","505px");
        };
    }
